import{_ as e,o as a,c as r,a5 as t}from"./chunks/framework.DnJ-_PtE.js";const _=JSON.parse('{"title":"初始界面","description":"","frontmatter":{},"headers":[],"relativePath":"webgis/geoserver.md","filePath":"webgis/geoserver.md","lastUpdated":1717756482000}'),s={name:"webgis/geoserver.md"},l=t('<p><a href="https://blog.csdn.net/SeptDays/article/details/103923719" target="_blank" rel="noreferrer">https://blog.csdn.net/SeptDays/article/details/103923719</a></p><p><a href="https://www.zhihu.com/question/62293246/answer/2395576780" target="_blank" rel="noreferrer">https://www.zhihu.com/question/62293246/answer/2395576780</a></p><p><a href="https://blog.csdn.net/wxljmy77/article/details/8834908/" target="_blank" rel="noreferrer">https://blog.csdn.net/wxljmy77/article/details/8834908/</a><a href="https://blog.csdn.net/lovefengruoqing/article/details/116754240" target="_blank" rel="noreferrer">https://blog.csdn.net/lovefengruoqing/article/details/116754240</a> geoserver</p><h1 id="初始界面" tabindex="-1">初始界面 <a class="header-anchor" href="#初始界面" aria-label="Permalink to &quot;初始界面&quot;">​</a></h1><h2 id="状态" tabindex="-1">状态 <a class="header-anchor" href="#状态" aria-label="Permalink to &quot;状态&quot;">​</a></h2><p>● 状态：页面显示服务器配置参数和运行时状态的 ● GeoServer日志：页面显示地理服务器日志输出。这对于在不必离开浏览器的情况下确定错误非常有用 数据 ● 图层预览： 页面以各种输出格式提供指向图层预览的链接，包括常用的OpenLayers和KML格式。此页面有助于直观地验证和探索特定层的配置。 无需登录到GeoServer即可访问图层预览。 ● 工作空间： 页面显示工作区列表，可以添加、编辑和删除。还显示服务器的默认工作空间。工作空间对于组织图层非常有用。 可以将多个图层关联到一个工作空间。 允许具有多个同名图层，只要它们位于不同的工作空间中。 ● 存储仓库： 页面显示存储列表，可以添加、编辑和删除。详细信息包括与存储关联的工作空间、存储类型（数据格式）以及是否启用。GeoServer连接到数据所在的存储库，每个存储仓库必须在一个工作空间中。 数据类型：矢量数据（Shapefile，Directory of spatial files (shapefiles) ，PostGIS，CSV等） 栅格数据（GeoTIFF、WorldImage，ArcGrid） ● 图层： 页面显示层列表，可以添加、编辑和删除。详细信息包括与图层关联的工作空间和存储、图层是否已启用以及图层的空间参考系统。 ● 图层组： 页面显示具有添加、编辑和删除功能的图层组列表。 ● 样式： 页面显示样式列表，可以添加、编辑和删除。</p><h2 id="服务" tabindex="-1">服务 <a class="header-anchor" href="#服务" aria-label="Permalink to &quot;服务&quot;">​</a></h2><p>● Web Coverage Service (WCS)：发布基于栅格的图层, 页面管理WCS的元数据、资源限制和SRS可用性 ● Web Feature Service (WFS): 提供来自GeoServer图层的原始矢量数据,页面管理WFS的元数据、功能发布、服务级别选项和特定于数据的输出。WFS通过OGC Filter构造查询条件，支持基于空间几何关系的查询，基于属性域的查询，当然还包括基于空间关系和属性域的共同查询 ● Web Map Service (WMS): 用于将数据发布为地图,页面管理WMS的元数据、资源限制、SRS可用性和其他特定于数据的输出 ● Web Map Tile Service（WMTS): Web地图瓦片服务</p><h2 id="设置" tabindex="-1">设置 <a class="header-anchor" href="#设置" aria-label="Permalink to &quot;设置&quot;">​</a></h2><p>● 全局： 页面为整个服务器配置消息、日志、字符和代理设置 ● 图像处理： 页面配置Java高级图像处理相关的设置，内存容量，内存阈值，切片线程，切片线程优先级等，WMS和WCS操作都使用这些参数 ● 栅格访问设置： 页面配置与加载和发布栅格文件相关的设置</p><h2 id="瓦片缓存" tabindex="-1">瓦片缓存 <a class="header-anchor" href="#瓦片缓存" aria-label="Permalink to &quot;瓦片缓存&quot;">​</a></h2><p>● 切片图层： 显示GeoServer中的哪些层也可用作瓦片（缓存）层，并具有添加、编辑和删除功能 ● 默认缓存： 设置缓存服务的全局选项 ● 网格集： 显示瓦片缓存的所有可用网格集，并可以添加、编辑和删除 ● 磁盘配额： 可以为每个层设置预定义的空间量 ● BlobStores： 为内置的geowebcache配置不同blobstores（tile缓存源）</p><h1 id="发布wms" tabindex="-1">发布WMS <a class="header-anchor" href="#发布wms" aria-label="Permalink to &quot;发布WMS&quot;">​</a></h1><p><a href="https://blog.csdn.net/BADAO_LIUMANG_QIZHI/article/details/109636080" target="_blank" rel="noreferrer">https://blog.csdn.net/BADAO_LIUMANG_QIZHI/article/details/109636080</a></p><p><a href="https://docs.geoserver.org/stable/en/user/gettingstarted/shapefile-quickstart/index.html" target="_blank" rel="noreferrer">https://docs.geoserver.org/stable/en/user/gettingstarted/shapefile-quickstart/index.html</a> 发布服务及替换样式 <a href="https://zhuanlan.zhihu.com/p/470580056" target="_blank" rel="noreferrer">https://zhuanlan.zhihu.com/p/470580056</a></p><h1 id="跨域问题" tabindex="-1">跨域问题 <a class="header-anchor" href="#跨域问题" aria-label="Permalink to &quot;跨域问题&quot;">​</a></h1><p><a href="https://blog.csdn.net/BADAO_LIUMANG_QIZHI/article/details/124128542" target="_blank" rel="noreferrer">https://blog.csdn.net/BADAO_LIUMANG_QIZHI/article/details/124128542</a></p><h1 id="wmts-wcs-wfs-wms" tabindex="-1">WMTS wcs wfs wms <a class="header-anchor" href="#wmts-wcs-wfs-wms" aria-label="Permalink to &quot;WMTS wcs wfs wms&quot;">​</a></h1><h2 id="wms服务参数" tabindex="-1">WMS服务参数 <a class="header-anchor" href="#wms服务参数" aria-label="Permalink to &quot;WMS服务参数&quot;">​</a></h2><p>根据用户的请求，返回相应的地图，包括PNG、GIF、JPEG等栅格形式，或SVG或者WEB CGM等矢量形式。WMS支持HTTP协议，所支持的操作是由URL决定的。</p>',20),o=[l];function i(n,h,c,d,p,b){return a(),r("div",null,o)}const g=e(s,[["render",i]]);export{_ as __pageData,g as default};
